Description:
Ethnicity-associated taxa match between the HMP and AGP. Bar plots depict the log10 transformed relative abundance for individuals possessing the respective
taxon within each ethnicity, ubiquity appears above (AGP) or below (HMP) bars, and the 25th and 75th percentiles are shown with extending whiskers. MannWhitney
U tests evaluate differences in abundance and ubiquity for all individuals between pairs of ethnicities;

Taxonomic composition of the gut microbiota in the different datasets.

Data presented as average  standard deviation; P-values from ANOVA testing differences among lean, overweight, and obese subjects. WC = waist circumference;
NA = not available.

